(73637, '2123BB17-1E97-452B-9572-77C98B78F827', 'I want to acknowledge that what I said about you and your leadership was wrong and hurtful and I’m sorry. I let one of my most annoying and harsh parts steal the mic. I know that providing, reactive psychological commentary about you and  judgements about your work and leadership capabilities are my own projections, and I take them back. I think you are a thoughtful, caring leader who works tirelessly to achieve outcomes for your Climbers…and you have high expectations of your team to do the same. You are open to very difficult feedback and digest and consider what people say thoughtfully. You work hard to build and maintain authentic relationships….from former in and out employees to billionaires…and treat them all with dignity and respect. These are all qualities I admire in you and try to emulate. I’m very sorry for the ugly comments I made and for jumping over my side of the fence in doing so. I’ve worked hard to not let that undeveloped, younger, defensive part go there anymore. I feel embarrassed that I regressed and caused you pain. Can chat about what triggered me…but this is not the time or channel for that. ', 'David', 'Nitzan', '2023-11-09T16:59:57.816452'),
(73638, '9453ED13-F946-4CF0-9E6C-07E52A0463E3', 'Thanks for this love. It means a lot. Looking forward to talking more in a bit. I️ know what triggered you and isolating that from an apology is a good way to go. ', 'Nitzan', 'David', '2023-11-09T18:16:49.023517'),
(73639, '9509A4C9-F585-4A90-8EBF-38F31FC14C5F', 'Your apology a few days ago didn’t land for me because you blamed it on me triggering you. ', 'Nitzan', 'David', '2023-11-09T18:17:07.082658'),
